
import numpy as np


class Multiplication:
    def __init__(self, num1: float, num2: float) -> None:
        self.num1 = num1
        self.num2 = num2
    def get_product(self) -> float:
        """
        Multiply two numbers .
        
        :param num1: first number to multipy .
        :type num1: float
        
        :param num2: second number to multipy.
        :type num2: float
        """
    
        return self.num1 * self.num2